import React from 'react';
import { Card, Avatar } from 'antd';

const UserProfile = () => {
    return (
        <Card   
            actions={[
                <div key="twit">짹쨱<br />0</div>,
                <div key="followings">팔로잉<br />0</div>,
                <div key="followiner">팔로워<br />0</div>,
            ]}
        >            
            <Card.Meta 
                avatar={<Avatar>MS</Avatar>}
                title="minsang"
            />
        </Card>
    )
}

export default UserProfile;
